const App = () => {
  let obj = ["Ronald", 21];

  console.log("Hello from App Component");
  const date = new Date();
  const a = 10;
  const b = 11;
  return (
    <div>
      <h1>{date.toString()}</h1>
      <h1>
        {" "}
        {a} + {b} is {a + b}
        <Hello name={obj} />
      </h1>
    </div>
  );
};

const Hello = (props) => {
  return (
    <div>
      <h1>
        woah!! {props.name}, {props[2]}
      </h1>
    </div>
  );
};

export default App;
